Занимаемся формированием волонтерского отряда в целях реализации социально-значимых проектов.
В 2009-2010 годах нашей организацией в рамках общественно- значимой деятельности были проведены следующие мероприятия:
1. Организация родительского клуба встречи «Школа родительского мастерства» на базе  Детской библиотеки №2 г.Казани;
2. Проведение занятий по саморегуляции для педагогов средних общеобразовательных учреждений г.Казани - №№ 7, 69, 78, 129, 114, 122, 142 в рамках педагогических советов; 
3. Проведение психокоррекционных занятий для выпускников факультета психологии Института экономики, управления и права г. Казани в целях профилактики дистресса и коррекции эмоционального состояния;
4. Выступления на канале ТНВ в передаче «Утро» в рубрике «Советы психолога» (по четвергам – с октября 2009 года до сего дня).
5. Проведение обучающих семинаров «Возможности музыкальной выразительности африканских барабанов в профилактике и коррекции синдрома эмоционального выгорания» для курсантов Казанской государственной медицинской академии.
6. Открытие семейной арт-студии «Ритмы сердца» в рамках Казанского филиала  Тольяттинской школы «Барабаны мира» (www. barabanymira).
